function multiplyNumbers(num1: number, num2: number): number {
    return num1 * num2;
}

function divideNumbers(num1: number, num2: number): number | string {
    if(num2 === 0) {
       return 'Error: Division by zero';
    }
    return num1 / num2;
}

function subtractNumbers(num1: number, num2: number): number {
    return num1 - num2;
}
